import React from "react";
import Head from "next/head";
import AppLayout from "../components/AppLayout";

const Signup = () => (
  <AppLayout>
    <Head>
      <title>NTB</title>
    </Head>
    <div>Hello, 회원가입</div>
  </AppLayout>
);

export default Signup;
